import React from 'react';

function app(){
    return (
        <>
        <h1>Calculater</h1>
        <ul>
        <li>Add : </li>
        <li>Sub : {add(40,4)}</li>
        <li>Mult : {add(40,4)}</li>
        <li>Div : {add(40,4)}</li>
    </ul> 
    </>
 );
}

export default app;
